part = function(name, size, brickColor, cframe, parent)
	local p = Instance.new("Part")
	p.Anchored = true
	p.Locked = true
	p.Size = size
	p.BrickColor = brickColor
	p.Name = name
	p.CFrame = cframe
	p.Parent = parent

	return p
end

main = function()
	local model = Instance.new("Model",workspace)
	for i,v in pairs(partData) do
		part(v.name, v.size, v.brickColor, v.cframe, model)
	end
end

main()
